ControlPropertyState.AutoRuleBindingString:
// OnSelect of Logout button
Set(CurrentUser, Blank());
Set(varUser, Blank());
Set(varResetLogin, true);   // trigger labels to go blank
Reset(ddBranch);
Reset(txtPassword);
Navigate('Login Screen', ScreenTransition.Fade);

// OnSelect of Logout button
Set(CurrentUser, Blank());
Set(varUser, Blank());
Set(varResetLogin, true);   // trigger labels to go blank
Reset(ddBranch);
Reset(txtPassword);
Navigate('Login Screen', ScreenTransition.Fade);

Set(
    varMasterRecord,
    LookUp(
        FD_Master,
        'A/c No.' = txtAcNo_1.Text    // replace with your actual SharePoint column name
    )
);

If(
    IsBlank(varMasterRecord),
    Notify(" No record found for this A/c No", NotificationType.Error),
    // else record found
    Notify(" Record found, details loaded", NotificationType.Success);

    // Normalize period value (like 181D, 12M, 1Y)
    Set(varPeriodNorm, Upper(Substitute(Trim(varMasterRecord.Period), " ", "")));
    Set(varPeriodUnit, Right(varPeriodNorm, 1));
    Set(varPeriodNumber, Value(Left(varPeriodNorm, Len(varPeriodNorm) - 1)));

    // Validation
    If(
        (varPeriodUnit = "D" && varPeriodNumber < 366) ||
        (varPeriodUnit = "M" && varPeriodNumber < 12) ||
        (varPeriodUnit = "Y" && varPeriodNumber < 1),
        Notify(" Only FD periods of 1 year (12M / 366D / 1Y) or more will get approved.", NotificationType.Warning)
    )
)
